let dataUser = undefined
let usuarioLogueado;
let txtNombre1 = document.getElementById('Nombre1')
let txtNombre2 = document.getElementById('Nombre2')
let txtApellido1 = document.getElementById('Apellido1')
let txtApellido2 = document.getElementById('Apellido2')
let txtEmail = document.getElementById('email')
let txtTelefono = document.getElementById('telefono')
let imgPerfil = document.getElementById('imgPerfil');
let imgData;
let imgType;
let base64String;

function getNoAvatarBase64() {
    return 'data:image/png;base64,';
}

document.addEventListener("DOMContentLoaded", function(e) {
    usuarioLogueado = recuperarUsuario(localStorage.getItem("usuario"));
    cargarValidacionForm();
    cargarDatosEnForm();
})

function cargarValidacionForm() {
    let form = document.getElementById('formPerfil');
    form.addEventListener('submit', function(event) {       
        event.preventDefault();
        if (!form.checkValidity()) {            
            event.preventDefault()
            event.stopPropagation()
        }
        form.classList.add('was-validated')
    }, false)
}

function cargarDatosEnForm() {
    usuarioLogueado = recuperarUsuario(localStorage.getItem("usuario"));
    if(usuarioLogueado.avatar === '') {
        usuarioLogueado.avatar = getNoAvatarBase64();
        actualizarUsuario(usuarioLogueado);
    }
    txtNombre1.value = usuarioLogueado.primerNombre;
    txtNombre2.value = usuarioLogueado.segundoNombre;
    txtApellido1.value = usuarioLogueado.primerApellido;
    txtApellido2.value = usuarioLogueado.segundoApellido;
    txtTelefono.value = usuarioLogueado.telefono;
    imgPerfil.src = usuarioLogueado.avatar;
    txtEmail.value = usuarioLogueado.email;
}

function guardarDatos() {
    usuarioLogueado = recuperarUsuario(localStorage.getItem("usuario"));
    let form = document.getElementById('formPerfil')
    if(form.checkValidity()){
        usuarioLogueado.primerNombre = txtNombre1.value;
        usuarioLogueado.segundoNombre = txtNombre2.value;
        usuarioLogueado.primerApellido = txtApellido1.value;
        usuarioLogueado.segundoApellido = txtApellido2.value;
        usuarioLogueado.telefono = txtTelefono.value;
        usuarioLogueado.avatar = base64String;
        actualizarUsuario(usuarioLogueado);
        
        htmlMensaje = `
            <div class="alert alert-success alert-dismissible fade show" role="alert">
                <button id='btnCierreModal' type="button" class="btn-close" data-bs-dismiss="alert" aria-label="Close"></button>
                <p></p>
                <h5 class="alert-heading">Has modificado tus datos con xito!</h5>
                <p></p>
                <p class="mb-0"></p>
            </div>
        `;
        document.getElementById("container-msg").innerHTML = htmlMensaje;
        ocultarDropzone();
        cargarDatosEnForm();
    }
}

//Configuraciones para el elemento que sube archivos
let dzoptions = {
    url: '/',
    autoProcessQueue: true,
    uploadMultiple: false,
    maxFiles: 1,
    maxFilesize: 20,
    acceptedFiles: 'image/*',
    addRemoveLinks: true,
    dictRemoveFile: 'Quitar'
};

let myDropzone = new Dropzone("div#file-upload", dzoptions);

myDropzone.on('addedfile', function(file) {
    imgType = file.type
    usuarioLogueado = recuperarUsuario(localStorage.getItem("usuario"));
    let reader = new FileReader();
    reader.onload = function(event) {
        base64String = event.target.result;
    };
    reader.readAsDataURL(file);
    //alert('Archivo subido');
})

myDropzone.on('removedfile', file => {
    //alert('Archivo eliminado');
})

function getBase64Image(dataUrl) {
    let cabezal = 'data:' + imgType + ';base64,';
    let retorno = dataUrl.replace(cabezal, "");
    return retorno;
}

function mostrarDropzone() {
    document.getElementById('divAvatar').hidden = true;
    document.getElementById('divDropzone').hidden = false;
    document.getElementById('cambiarAvatar').style.visibility = "hidden";
}

function ocultarDropzone() {
    document.getElementById('divAvatar').hidden = false;
    document.getElementById('divDropzone').hidden = true;
    document.getElementById('cambiarAvatar').style.visibility = "visible";
}